import { Component } from '@angular/core';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';

import jspdf from 'jspdf';
import html2canvas from 'html2canvas';

pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-acta-baja-create',
  standalone: true,
  imports: [],
  templateUrl: './acta-baja-create.component.html',
  styleUrl: './acta-baja-create.component.scss'
})
export class ActaBajaCreateComponent {
  userInput: string = 'xdxdxdxdx';

  generatePdf(data) {
    html2canvas(data, { scale: 2, allowTaint: true }).then(canvas => {
     let HTML_Width = canvas.width;
     let HTML_Height = canvas.height;
     let top_left_margin = 15;
     let PDF_Width = HTML_Width + (top_left_margin * 2);
     let PDF_Height = (PDF_Width * 1.5) + (top_left_margin * 2);
     let canvas_image_width = HTML_Width;
     let canvas_image_height = HTML_Height;
     let totalPDFPages = Math.ceil(HTML_Height / PDF_Height) - 1;
     canvas.getContext('2d');
     let imgData = canvas.toDataURL("image/jpeg", 3.0);
     let pdf = new jspdf('p', 'pt', [PDF_Width, PDF_Height]);
     pdf.addImage(imgData, 'jpg', top_left_margin, top_left_margin, canvas_image_width, canvas_image_height);
     for (let i = 1; i <= totalPDFPages; i++) {
       pdf.addPage([PDF_Width, PDF_Height], 'p');
       pdf.addImage(imgData, 'jpg', top_left_margin, -(PDF_Height * i) + (top_left_margin * 4), canvas_image_width, canvas_image_height);
     }
      pdf.save("HTML-Document.pdf");
   });
 }


  pdf(){
    const docDefinition = {
      content: [
        
        {
          image: 'data:image/png;base64,', // Replace with your image data
          width: 540,
          // height: 150
        },
        { text: 'User Input PDF', style: 'header' },
        { text: '--------------------------------', style: 'separator' },
        { text: this.userInput, style: 'content' },
        {
          table: {
            body: [
              ['Header1', 'Header2', 'Header3'],
              ['Row1 Col1', 'Row1 Col2', 'Row1 Col3'],
              ['Row2 Col1', 'Row2 Col2', 'Row2 Col3']
            ]
          },
          style: 'table'
        }
      ],
      styles: {
        header: {
          fontSize: 18,
          bold: true,
          margin: [0, 0, 0, 0]
        },
        separator: {
          margin: [0, 10, 0, 10]
        },
        content: {
          fontSize: 14,
          margin: [0, 0, 0, 0]
        },
        table: {
          margin: [0, 10, 0, 10]
        }
      }
    };

    pdfMake.createPdf(docDefinition).download('customized.pdf');
  }
}
